import React from 'react';
import FiberManualRecordIcon from '@material-ui/icons/FiberManualRecord';
import './TextContainer.css';
import logo from '../../images/logo.png';
import PeopleAltIcon from '@material-ui/icons/PeopleAlt';
import MeetingRoomIcon from '@material-ui/icons/MeetingRoom';

const TextContainer = ({ users, name }) => {
    console.log(users, 'users', name, "name");
    return (
        <div className="textContainer">
            {
                users
                    ? (
                        <div>
                            <img src={logo} width="100px"></img>
                            <h1><MeetingRoomIcon />Room: {name}</h1>
                            <h2><PeopleAltIcon /> Online users:</h2>
                            <div className="activeContainer">
                                <h2>
                                    {users.map(({ name_ }) => (
                                        <div key={name_} className="activeItem">
                                            {name_}
                                            <FiberManualRecordIcon style={{ color: '#ACD957' }} />
                                        </div>
                                    ))}
                                </h2>
                            </div>
                        </div>
                    )
                    : null
            }
        </div>
    )
};

export default TextContainer;
